window.bookSummaryJSON = "<p><b>One minute I had the cuffs. I had magic. I could fight. The next...it was all gone.</b></p> <p>The final semester at the Supernatural Academy should be about enjoying my last months of college. Instead, someone has poisoned the fae realm, killing tens of thousands and throwing those who survived to our doorstep.</p> <p>And, worse, no one knows how or why. So, instead of late-night study sessions and crazy parties, my friends and I must track down the person responsible for these atrocities.</p> <p>The one problem...I’m not who I used to be. I’m not even whole.</p> <p>How can I help stop the world’s most nefarious criminal with no magic and part of myself missing? And how can I do it without losing myself entirely? </p> <p><b>You will love the final book in this hot magical academy series with kick-ass action, sizzling romance, and earth-shattering magic that will make you tingle in all the right places. Get it now.</b></p>"; 
